insert /*+ append */ into <?=snpRef.getObjectName("L", "%INT_PRFTEST_SEC_USER", "W") ?> ( FULL_NAME, WINDOWS_UID, EMAIL_ADDRESS, LAST_LOGIN, IND_UPDATE ) select FULL_NAME, WINDOWS_UID, EMAIL_ADDRESS, LAST_LOGIN, IND_UPDATE from (
select
C1_FULL_NAME FULL_NAME, C2_WINDOWS_UID WINDOWS_UID, C3_EMAIL_ADDRESS EMAIL_ADDRESS, C4_LAST_LOGIN LAST_LOGIN,
'I' IND_UPDATE
from <?=snpRef.getObjectName("L", "%COL_PRF0TEST_SEC_USER", "BS_DSA", "W")?> where (1=1)
) S where NOT EXISTS ( select 1 from <?=snpRef.getObjectName("L", "TEST_SEC_USER", "BS_DSA", "", "D") ?> T where T.FULL_NAME = S.FULL_NAME and T.WINDOWS_UID = S.WINDOWS_UID and ((T.EMAIL_ADDRESS = S.EMAIL_ADDRESS) or (T.EMAIL_ADDRESS IS NULL and S.EMAIL_ADDRESS IS NULL)) and ((T.LAST_LOGIN = S.LAST_LOGIN) or (T.LAST_LOGIN IS NULL and S.LAST_LOGIN IS NULL)) )

begin
    dbms_stats.gather_table_stats(
	ownname => '<?=snpRef.getInfo("DEST_WORK_SCHEMA") ?>',
	tabname => '<?=snpRef.getObjectName("L", "%INT_PRFTEST_SEC_USER", "W").replaceAll(odiRef.getInfo( "DEST_WORK_SCHEMA" )+".","")?>',
	estimate_percent => dbms_stats.auto_sample_size
    );
end;


